import './TextFieldForm.css'

const TextFieldForm = (props) => {

    let inputValue = ''

    const changeValue = (events) => {
        inputValue = events.target.value
        // console.log(events.target.value)
    }

    return(
        <div className='text-field-form'>
            <label>{props.label}</label>
            <input value={inputValue} onChange={changeValue} required={props.required} placeholder={props.placeholder} />
        </div>
    )
}

export default TextFieldForm
